import React from 'react'
import TimeCard from './TimeCard'

//-------------------------------------------
export default function TimeCardList(props) {
    const {timeEntryList} = props;

    
    return(
        <div class='timecard-list'>
            {timeEntryList.map(timeEntry => (<TimeCard startTime={timeEntry.startTime} endTime={timeEntry.endTime} timeEntry={timeEntry.timeEntry} />))}
        </div>
    )
}
